import React, { useState, useEffect } from "react";
import Dropdown from 'react-bootstrap/Dropdown';

function TimeSelect(props) {

    return (
        <div style={{ display: 'block', 
                      width: '5vh', 
                      padding: '30',
                      paddingLeft: '30',
                      textAlign: 'center',
                       }}>

          <Dropdown>
            <Dropdown.Toggle>
              Select year
            </Dropdown.Toggle>
            <Dropdown.Menu>
              <Dropdown.Item href="#">
                Home Page
              </Dropdown.Item>
              <Dropdown.Item href="#">
                Settings
              </Dropdown.Item>
              <Dropdown.Item href="#">
                Logout
              </Dropdown.Item>
            </Dropdown.Menu>
          </Dropdown>
        </div>
      );
}

export default TimeSelect;
